export const initialState = {
    mainPosts: [{
      id: 1,
      Usdr: {
        id: 1,
        nickname: 홍길동,
      },
      content: "첫 번째 게시글 #해시태그 #익스프레스",
      Image: [{

      }],
      Comment: [{
        User: {
          nickname: "zero",
        },
        content: "안녕하세요 ",
      },{
        User: {
          nickname: "one",
        }
      }],
    }],
};

const reducer = (state = initialState, action) => {
  switch (action.type) {
    default:
      return state;
  }
};

export default reducer;
